import React from 'react';
import { Select as ChakraSelect}  from "@chakra-ui/react"

/***************************************************************/
export function Select(props) {
    const options = props.options
    const optionItems = options.map((option) => <option>{option}</option>);

    return (
    <>
      <ChakraSelect {...props}>
          {optionItems}
      </ChakraSelect>
    </>
  );
}
